import React from "react";
import "../../css/bootstrap.min.css";
import "./Navbar.css";
import { Link } from "react-router-dom";
import Toggle from "../../../assets/images/toggle.png"

class NavBar extends React.Component {
  state = {
    mostrar: 0,
    class: "hidden",
  };
  menu = () => {
    if (this.state.mostrar === 0) {
      this.setState({
        mostrar: 1,
        class: "show",
      });
    } else {
      this.setState({
        mostrar: 0,
        class: "hidden",
      });
    }
  };
  render() {
    return (
      <div>
        <nav className="navbar-expand background ">
          <div className={this.state.class}>
            <ul className="navbar-expand navbar-nav justify-between">
              <Link to="/blog-data-science">
                <li>{this.props.link1}</li>
              </Link>
              <Link to="/content">
                <li>{this.props.link2}</li>
              </Link>
              <Link to="/data">
                <li>{this.props.link3}</li>
              </Link>
              <Link to="/help">
                <li>{this.props.link4}</li>
              </Link>
            </ul>
          </div>
          <button
            onClick={this.menu}
            className="hidden-button"
            style={{ color: "white" }}
          >

            <img
              height="35px"
              src={Toggle}
              style={{
                fill: "white"
              }}
              alt="Toggle"
            />
          </button>
        </nav>
      </div>
    );
  }
}

export default NavBar;

